import React, {Component} from 'react'
import logoimg from '../img/logo.svg'
import 'bootstrap/dist/css/bootstrap.min.css'

class Logo extends Component {
    render() {
        return (
            <div>
                <div style={logoStyle}>
                    <a href="#" style={logoStyle}>Powered by: <img src={logoimg} style={logoimgStyle} alt='Visit Creator`s site' placeholder='jhjllk'/></a>
                </div>
            </div>
        )
    }
}
const logoStyle = {
    textDecoration: 'none',
    fontWeight: '600',
    fontSize: '1.05em',
    color: 'white',
    position: 'fixed', 
    bottom: '7px',
    right: '7px',
    backgroundColor: '#333',
    opacity: "0.9",
    padding: '2px',
}
const logoimgStyle = {
    width: '50%',
    float: 'right',
}
export default Logo
